import React from 'react';
import ReactDOM from 'react-dom';

const FahrenheitInput = () =>{
  return(
    <label>
      Fahrenheit
      <input 
      type="Number" 
      id="fahrenheit"
      />
    </label>
  );
}
const CelsiusInput = () =>{
  return(
    <label>
      Fahrenheit
      <input 
      type="Number" 
      id="celsius"
      />
    </label>
  );
}

class App extends React.Component{
render(){
    return(
      <div>
        <h2>
          Temperature Conversion
        </h2>
        <FahrenheitInput/>
        <CelsiusInput/>
      </div>
    );
  }
}


ReactDOM.render(
    <App />,
  document.getElementById('root')
);
